import {cakes, cakes as cakeData} from "./Cake.data";
import React, {useState} from "react";
import CakeItem from './CakeItem'
const Home = () => {
    const [cars,setCars] = useState(cakeData)
    return (
        <>
            <h1>Cake catalog</h1>
            <div>
                {cars.length? (cars.map(cake => <CakeItem key = {cake.id} cake={cake}/>
                ))
                : <p>there are no cakes</p>
                }
            </div>
        </>
    )
}

export default Home
